import React, { Component } from 'react'
import Library from './library/Library';
import Landing from './Landing';
import Popular from './popular/Popular';
import { Header, Footer, Container} from '../index'

class Home extends Component {
    render() {
        return (
            <>
                <Header />
                <Container>
                    <Landing />
                    <Popular />
                    <Library />
                </Container>
                <Footer />
            </>
        )
    }
}

export default Home;
